import React from 'react';
import {Container} from "react-bootstrap";

const Forum = () => {
    return (
        <div>
           <Container className={"m-3"}>
               <h2>Название темы</h2>
               Описание темы
           </Container>
        </div>
    );
};

export default Forum;
